const Question = ({ question, answers, correct_answers, nextQuestion, countQuestion }) => {


  return (


    <div>
      <p>Question: {countQuestion}</p>
      <h1>{question}</h1>

      <p>{answers.answer_a}</p>
      <p>{answers.answer_b}</p>
      <p>{answers.answer_c}</p>
      <p>{answers.answer_d}</p>
      <p>{answers.answer_e}</p>
      <p>{answers.answer_f}</p>
      <button onClick={nextQuestion}> Next</button>


    </div>


  );
};

export default Question;
